import React from 'react';
import '../../App.css';
import SignUpForm from "../RegisterForm";
import Footer from "../Footer";

export default function SignUp() {
    return (
        <>
            <div className='sign-up'>
                <div className='center patternPadding'>
                    <SignUpForm/>
                </div>
                <Footer />
            </div>
        </>
    );
}
